const CustomPage = (prop) => {
    const page = prop.page;
    const setPage = prop.setPage;
    const totalpages = prop.totalpages;

    return ( 
        <div className="flex justify-center ">
            <button onClick={() => {
                if(page!=1){
                    setPage = page-1;
                }
            }} className ="border-2 bg-sky-100 border-slate-800 px-2 py-1 rounded-lg">Prev</button>
            <button className="px-2">{page}</button>
            <button onClick={() => {
                if(page != totalpages){
                    setPage = page+1;
                }
            }} className="border-2 border-slate-800 px-2 py-1 rounded-lg" >Next</button>

        </div>
     );
}
 
export default CustomPage;
